-- This file is to bootstrap a database for the CS3200 project. 

-- Create a new database.  You can change the name later.  You'll
-- need this name in the FLASK API file(s),  the AppSmith 
-- data source creation.
create database health;

-- Via the Docker Compose file, a special user called webapp will 
-- be created in MySQL. We are going to grant that user 
-- all privilages to the new database we just created. 
-- TODO: If you changed the name of the database above, you need 
-- to change it here too.
grant all privileges on health.* to 'webapp'@'%';
flush privileges;

-- Move into the database we just created.
-- TODO: If you changed the name of the database above, you need to
-- change it here too. 

use health;

# Strong Entities
############################################################
CREATE TABLE Doctor
(
    DoctorID      INT,
    fName         varchar(100) NOT NULL,
    lName         varchar(100) NOT NULL,
    MDorDO        varchar(2) NOT NULL,
    LicenseStatus Boolean NOT NULL, # Is the license active or not?
    Specialty varchar(200) NOT NULL,
    Email varchar(200) NOT NULL UNIQUE,
    PRIMARY KEY (DoctorID)
);


CREATE TABLE Practice
(
    PracticeNumber INT,
    PracticeName varchar(200),
    Phone        varchar(100),
    City         varchar(100) NOT NULL,
    State        varchar(200) NOT NULL,
    Zip          BIGINT NOT NULL,
    Num_ORs      INT,
    PRIMARY KEY (PracticeNumber)
);

CREATE TABLE Insurance
(
    CompanyID INT,
    CompanyName varchar(200),
    Coverage    BIGINT NOT NULL,
    PRIMARY KEY (CompanyID)
);

CREATE TABLE Pharmacy
(
    PharmID     INT,
    CompanyName varchar(200) NOT NULL,
    City        varchar(100) NOT NULL,
    State       varchar(200) NOT NULL,
    Zip         BIGINT NOT NULL,
    Phone       varchar(100),
    Primary Key (PharmID)
);

CREATE Table MedicalCondition
(
    ConditionID INT,
    ConditionName    varchar(1000),
    Prevalence       BIGINT,
    DateDiscovered   DATETIME NOT NULL,
    TreatmentOptions varchar(1000),
    Transmissible    boolean NOT NULL,
    Causes           varchar(1000),
    Severity         INT,
    Primary Key (ConditionID)
);

CREATE TABLE Patient
(
    SSN         INT,
    DOB         DATETIME NOT NULL,
    fName       varchar(100) NOT NULL,
    lName       varchar(100) NOT NULL,
    Phone       varchar(100),
    CompanyID INT, # Can be null because a patient does not need to have insurance
    PlanType    varchar(200),
    Expiration  DATETIME,
    PRIMARY KEY (SSN),
    FOREIGN KEY (CompanyID) references Insurance (CompanyID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE Table ChemicalCompounds
(
    ChemID          INT,
    BoilingPoint    INT,
    MeltingPoint    INT,
    ScientificName  varchar(2000) NOT NULL,
    CommonName      varchar(2000),
    MolecularWeight FLOAT(2),
    PRIMARY KEY (ChemID)
);

CREATE TABLE Pharmacist
(
    EmployeeID        INT,
    fName             varchar(200) NOT NULL,
    lName             varchar(200) NOT NULL,
    LicenseExpiration DATETIME NOT NULL,
    PharmID           INT, # Can be null because a pharmacist does not need to belong to a Pharmacy
    PRIMARY KEY (EmployeeID),
    FOREIGN KEY (PharmID) references Pharmacy (PharmID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Medication
(
    MedID           INT,
    BrandName       varchar(200) NOT NULL,
    GenericName     varchar(2000) NOT NULL,
    Med_Description varchar(1000) NOT NULL,
    PRIMARY KEY (MedID)
);

CREATE TABLE EducationalInstitute
(
    InstitutionID INT,
    InstitutionName    varchar(1000),
    City               varchar(1000) NOT NULL,
    State              varchar(2000) NOT NULL,
    Zip                BIGINT NOT NULL,
    Current_Enrollment BIGINT,
    Current_Endowment  varchar(1000),
    PRIMARY KEY (InstitutionID)
);
############################################################

# Weak Entities:
############################################################
CREATE TABLE DoctorReviews
(
    ReviewID        INT auto_increment,
    Rating          INT NOT NULL, # A Review must have a rating
    Rev_Description varchar(2000),
    DoctorID        INT NOT NULL,
    PRIMARY KEY (ReviewID, DoctorID),
    FOREIGN KEY (DoctorID) references Doctor (DoctorID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

# ALTER TABLE DoctorReviews AUTO_INCREMENT=1001;

CREATE TABLE Prescription
(
    PrescID              INT,
    Dosage               varchar(1000) NOT NULL,
    MedicationCommonName varchar(2000) NOT NULL,
    SSN                  INT NOT NULL,
    DoctorID             INT NOT NULL,
    PharmID              INT NOT NULL,
    MedID                INT NOT NULL,
    PRIMARY KEY (PrescID, SSN, DoctorID, PharmID, MedID),
    FOREIGN KEY (SSN) references Patient (SSN)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (DoctorID) references Doctor (DoctorID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (PharmID) references Pharmacy (PharmID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (MedID) references Medication (MedID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);
############################################################

# Bridge Tables for M:N Relationships
############################################################
CREATE TABLE Patient_diagnosed_MedicalCondition
(
    ConditionID INT,
    SSN           INT,
    PRIMARY KEY (ConditionID, SSN),
    FOREIGN KEY (ConditionID) references MedicalCondition (ConditionID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (SSN) references Patient (SSN)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Medication_contains_ChemicalCompounds
(
    ChemID INT,
    MedID  INT,
    PRIMARY KEY (ChemID, MedID),
    FOREIGN KEY (ChemID) references ChemicalCompounds (ChemID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (MedID) references Medication (MedID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Pharmacy_contains_Medication
(
    MedID      INT,
    PharmID    INT,
    UnitCost   FLOAT(2),
    QtyInStock INT,
    PRIMARY KEY (MedID, PharmID),
    FOREIGN KEY (MedID) references Medication (MedID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (PharmID) references Pharmacy (PharmID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Doctor_treats_Patient
(
    DoctorID        INT,
    SSN             INT,
    AppointmentDate DATETIME,
    Cost            FLOAT(2),
    Primary Key (DoctorID, SSN),
    FOREIGN KEY (DoctorID) references Doctor (DoctorID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (SSN) references Patient (SSN)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Doctor_worksAt_Practice
(
    DoctorID     INT,
    PracticeNumber INT,
    PRIMARY KEY (DoctorID, PracticeNumber),
    FOREIGN KEY (DoctorID) references Doctor (DoctorID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (PracticeNumber) references Practice (PracticeNumber)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Doctor_attended_EducationalInstitute
(
    DoctorID        INT,
    InstitutionID INT,
    startYear       BIGINT,
    endYear         BIGINT,
    Degree          varchar(2000),
    PRIMARY KEY (DoctorID, InstitutionID),
    FOREIGN KEY (DoctorID) references Doctor (DoctorID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (InstitutionID) references EducationalInstitute (InstitutionID)
        ON UPDATE RESTRICT
        ON DELETE CASCADE
);

CREATE TABLE Pharmacist_attended_EducationalInstitute
(
    EmployeeID      INT,
    InstitutionID INT,
    startYear       BIGINT,
    endYear         BIGINT,
    Degree          varchar(2000),
    PRIMARY KEY (EmployeeID, InstitutionID),
    FOREIGN KEY (EmployeeID) references Pharmacist (EmployeeID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (InstitutionID) references EducationalInstitute (InstitutionID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Practice_accepts_Insurance
(
    CompanyID  INT,
    PracticeNumber INT,
    PRIMARY KEY (CompanyID, PracticeNumber),
    FOREIGN KEY (CompanyID) references Insurance (CompanyID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (PracticeNumber) references Practice (PracticeNumber)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);
############################################################

# Multivalued Attributes
############################################################
CREATE TABLE Allergies
(
    Allergy varchar(200),
    SSN     INT,
    PRIMARY KEY (Allergy, SSN),
    FOREIGN KEY (SSN) references Patient (SSN)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Emails
(
    Email varchar(200),
    SSN   INT,
    PRIMARY KEY (Email, SSN),
    FOREIGN KEY (SSN) references Patient (SSN)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);
